def scan_info(processing_Queue,port_list):
    while not processing_Queue.empty():
        ip=processing_Queue.get()
        workQueue = queue.Queue()
        for port in port_list:
            workQueue.put(port) 
        for i in range(thread_num):
            thread = MyThread(ip=ip,q_port=workQueue)
            thread.start()
            threads.append(thread)
        for t in threads:
            t.join()
        if reslut_list[ip] != []:
            queueLock.acquire() #取得锁 
            write_result_detail(reslut_filename,ip,'http://'+ip,reslut_list[ip],app="app")
            reslut_list.pop(ip)
            queueLock.release() #释放锁 


def http_https_scan(host,port,schema):
    user_agent = 'Mozilla/4.0 (compatible; MSIE 5.5; Windows NT)'
    headers = {'User-Agent': user_agent}
    req = urllib.request.Request(schema+'://'+str(host)+':'+str(port),data=None,headers=headers)
    response = urllib.request.urlopen(req,timeout=timeout)
    html = response.read().decode('utf-8')
    title = re.search(r'<title>(.*?)</title>', html, flags=re.I | re.M)
    banner = title.group(1) if title else 'NULL'
    return banner


def print_color(data,color):
    if color == 'green': print('\033[1;32m%s\033[1;m' % data)
    elif color == 'blue' : print('\033[1;34m%s\033[1;m' % data)
    elif color=='gray' : print('\033[1;30m%s\033[1;m' % data)
    elif color=='red' : print('\033[1;31m%s\033[1;m' % data)
    elif color=='yellow' : print('\033[1;33m%s\033[1;m' % data)
    elif color=='magenta' : print('\033[1;35m%s\033[1;m' % data)
    elif color=='cyan' : print('\033[1;36m%s\033[1;m' % data)
    elif color=='white' : print('\033[1;37m%s\033[1;m' % data)
    elif color=='crimson' : print('\033[1;38m%s\033[1;m' % data)
    else : print(data)
    



def telnet_port(host,port):
    try:
        tn=telnetlib.Telnet(host, port=port, timeout=timeout)
        time.sleep(2)
        banner=tn.read_very_eager().decode('utf-8')
        if banner=="":
                tn.write('help\n'.encode('utf-8'))
                time.sleep(2)
                banner=tn.read_very_eager().decode('utf-8')
        # 80,443,8080默认都使用http请求；如果banner不为空，且有bad request或者<html>关键字则发起http请求
        if (port in ['80','443','8080']) or (banner!="" and (banner.lower().find("bad request")!=-1 or banner.find("<html>")!=-1)): 
            try:
                banner = http_https_scan(host,port,'http')
            except urllib.error.URLError as e:
                if e.code == 400:
                    try:
                        banner = http_https_scan(host,port,'https')
                    except urllib.error.URLError as e:
                        html=e.read().decode('utf-8')
                        title = re.search(r'<title>(.*?)</title>', html, flags=re.I | re.M)
                        banner = title.group(1) if title else 'NULL'
                        return (host, port,banner)
                    except Exception as e:
                        return 'NULL', 'NULL', 'NULL'
        return host,port,banner    
    except:
        return 'NULL','NULL','NULL'


def get_port_list(port):
    try:
        port_list = []
        tmp_list = port.split(',')
        for p in tmp_list:
            if p.find('-')!=-1:
                start_end=p.split('-')
                start=int(start_end[0])
                end=int(start_end[1])
                if start>end:
                    raise Exception
                for i in range(start,end):
                    port_list.append(str(i))
            else:
                port_list.append(p)
        return port_list
    except:
        print_color('Port error ! , Ex: 21-22,445,80-88,1433,27017,3306,3389,6379,8080-8088,9200','red')
        exit(0)


def write_result_templet(filename):
    mo_html = base64.b64decode("")
    result = open(filename,"w")
    result.write(mo_html.decode('utf8'))
    result.close()


def write_result_detail(filename,i_host,url,port_banner,app="app"):
    content_html = '<ul class="result device">'
    content_html += '''<li><h3><a class="ip">''' +i_host+'''</a><a class="original hint--bottom" target="_blank" href="''' +url+'''" data-hint="在新窗口打开" style="display: inline;"><sup><i class="iconfont icon-new-window"></i></sup></a></h3><hr><article class="port">'''
    content_html += '''<ul class="tags"><li class="app"><a>'''+'标签'+'''</a></li>'''
    content_html += '''<li class="device"><a>URL: '''  +url+'''</a></li></ul><div class="hostname"></div></article>'''
    for i in port_banner:
        port=i[0]
        banner=i[1]
        content_html += '''<section class="banner"><header><i><a>'''+port+'''</a></i></header><pre>'''+html.escape(banner)+'''</pre></section></li>'''
    content_html += '</ul>'  
    result = open(filename,"a+")
    result.write(content_html)
    result.close()

